window.bookSummaryJSON = "<p><b>She survived impact...but her plans burned up on reentry.</b></p> <p>Spending her inheritance on a luxury cruise is the most reckless thing Hope has ever done, and she’s loving every second of it...right up to the explosion.</p> <p>Now she’s stuck on a strange planet filled with countless dangers and just one chance to survive. The problem? He’s huge, scarred, and the scariest thing on this planet. He’s also the sexiest male she’s ever seen. His protection comes at a price, though. <i>Her.</i></p> <p>The life she envisioned is gone forever, but she might be on the brink of finding something better...if she can let go of what she wants to embrace what she <i>needs</i>.</p> <p><i>Buckle up. This sci-fi romance contains an alien with fur, fangs, horns, and a very possessive attitude when it comes to the woman he’s claimed for his own.</i></p>"; 
